  const dict = {
    c: "apple",
    b: "banana",
    a: "orange"
  };

  for (const [key, value] of Object.entries(dict).sort((a, b) => a[0].localeCompare(b[0]))) {
    console.log(`${key}: ${value}`);
  }

In this example, we first create a dictionary with some key-value pairs. Then, we use the `Object.entries()` method to get an array of key-value pairs from the dictionary. We then sort this array using the `sort()` method and the `localeCompare()` function to compare the keys alphabetically. Finally, we loop through the sorted array and print each key-value pair to the console.
